//====== ANCHOR Structs ======//
typedef int boolean;

typedef struct
{
    int x;
    int y;
} Point2d;

typedef struct
{
    Point2d p1;
    Point2d p2;
} Point2dPair;

typedef struct
{

    double xSpeed;
    double ySpeed;
} Velocity;

typedef Point2dPair Rectangle;
typedef Point2dPair Line;
typedef int TankId;
typedef int BulletId;

typedef struct
{
    Point2d position;
    double length;
    double angle;

    double angleVelocity;
    int colour;
} GunBarrel;

typedef struct
{
    TankId tankId;
    Point2d position;
    Rectangle hitBox;
    GunBarrel gunBarrel;
    double width;
    double height;
    int colour;
    int health;
    int prevhealth;

    Velocity velocity;

    int yAcceleration;
    boolean isBoosting;

} Tank;

typedef struct
{
    Point2d position;
    double width;
    double height;
    Velocity velocity;
    int colour;
    boolean exists;
    int yAcceleration; // can add a global var for gravity?

    Point2d hitPosition;
    int explosionTimer;

} Bullet;

typedef struct
{
    double angle;
    int colour;
    boolean wrapAround;
    float sin;
    float cos;

} Renderer;

// for drawing it only knows we want to draw line or rec
//  it knows speifics like angle / colour in renderer

typedef struct
{
    Rectangle rectangle;
    int colour;
} Platform;

typedef struct
{
    int colour;
    Point2d center;
    int radius;
} Circle;

typedef struct
{
    Platform platforms[NUM_PLATFORMS];
    Tank tank1;
    Tank tank2;
    Bullet bullet1;
    Bullet bullet2;

    int player1Score;
    int player2Score;
    int oldplayer1Score;
    int oldplayer2Score;

    int numBullets;

} GameState;

