// diff = p2 - p1, elementwise
#define SUBTRACT_POINT2D(diff, p2, p1) \
    diff.y = p2.y - p1.y;              \
    diff.x = p2.x - p1.x;

Point2d subtractPoint2d(const Point2d p2, const Point2d p1)
{
    // Hope for return value optimization
    return (Point2d){p2.x - p1.x, p2.y - p1.y};
}

Point2d offsetPoint2d(const Point2d p, int xOffset, int yOffset)
{
    // Hope for return value optimization
    return (Point2d){modulo(p.x + xOffset, RESOLUTION_X), p.y + yOffset};
}

// master <- comparePoint, elementwise, if comparePoint is
// positive
#define UPDATE_IF_POSITIVE_POINT2D(master, comparePoint) \
    if (comparePoint.x >= 0)                             \
    {                                                    \
        master.x = comparePoint.x;                       \
    }                                                    \
    if (comparePoint.y >= 0)                             \
    {                                                    \
        master.y = comparePoint.y;                       \
    }

#define UPDATE_IF_NEGATIVE_POINT2D(master, comparePoint) \
    if (comparePoint.x <= 0)                             \
    {                                                    \
        master.x = comparePoint.x;                       \
    }                                                    \
    if (comparePoint.y <= 0)                             \
    {                                                    \
        master.y = comparePoint.y;                       \
    }

