    printf("Point: x: %d, y: %d\n", point2d.x, point2d.y);

Point2d makePoint2d(int x, int y)
{
    Point2d tmp;
    tmp.x = x;
    tmp.y = y;
    return tmp;
}

Line makeLineByPoint(Point2d p1, Point2d p2)
{
    Line tmp;
    tmp.p1 = p1;
    tmp.p2 = p2;
    return tmp;
}

Line makeLineFromCartesian(int x1, int y1, int x2, int y2)
{
    Point2d p1 = makePoint2d(x1, y1);
    Point2d p2 = makePoint2d(x2, y2);
    return makeLineByPoint(p1, p2);
}

// Handles negative numbers.
int modulo(int x, int N)
{
    return (x % N + N) % N;
}

