void updateTankGameState(Tank *tank)
{
    // We will check the bounding boxes the current tank with
    // all other objects and calculate the maximum distance
    // that the tank can travel in both directions without collisions.
    Point2d maxPosMovement = CREATE_POINT2D(1000, 1000);
    Point2d maxNegMovement = CREATE_POINT2D(-1000, -1000);
    calculateMaximumAllowedMovement(tank, &maxPosMovement, &maxNegMovement);

    // if (tank->tankId == 1)
    // {
    //     printf("Tank %d\n", tank->tankId);
    //     PRINT_POINT2D(maxPosMovement);
    //     PRINT_POINT2D(maxNegMovement);
    // }

    if (tank->velocity.xSpeed > 0)
    {
        if (tank->velocity.xSpeed > maxPosMovement.x)
        {
            tank->position.x += maxPosMovement.x;
        }
        else
        {
            tank->position.x += tank->velocity.xSpeed;
        }
    }
    else if (tank->velocity.xSpeed < 0)
    {
        if (tank->velocity.xSpeed < maxNegMovement.x)
        {
            tank->position.x += maxNegMovement.x;
        }
        else
        {
            tank->position.x += tank->velocity.xSpeed;
        }
    }
    // No need for xSpeed == 0 as then we wouldn't need any updates.

    // To allow for wrap-around
    tank->position.x = modulo(tank->position.x, RESOLUTION_X);

    // Y position updating
    if (tank->velocity.ySpeed > 0)
    {
        if (tank->velocity.ySpeed > maxPosMovement.y)
        {
            tank->position.y += maxPosMovement.y;
        }
        else
        {
            tank->position.y += tank->velocity.ySpeed;
        }
    }
    else if (tank->velocity.ySpeed < 0)
    {
        if (tank->velocity.ySpeed < maxNegMovement.y)
        {
            tank->position.y += maxNegMovement.y;
            tank->velocity.ySpeed = 0;
        }
        else
        {
            tank->position.y += tank->velocity.ySpeed;
        }
    }
    if (!tank->isBoosting)
    {
        tank->velocity.ySpeed += tank->yAcceleration;
    }

    tank->position.y = modulo(tank->position.y, RESOLUTION_Y);


    // Gun Barrel rotations
    tank->gunBarrel.angle += tank->gunBarrel.angleVelocity;
    if (tank->gunBarrel.angle < 0)
    {
        tank->gunBarrel.angle = 0;
    }
    else if (tank->gunBarrel.angle > PI)
    {
        tank->gunBarrel.angle = PI;
    }
}

void calculateMaximumAllowedMovement(Tank *tank, Point2d *maxPosMovement, Point2d *maxNegMovement)
{
    // Top right distances
    Point2d posDifference;
    // Bottom left distances
    Point2d negDifference;

    Tank *otherTank;
    // First calculating collisions with the other tank
    if (tank->tankId == gameState.tank1.tankId)
    {
        otherTank = &gameState.tank2;
    }
    else
    {
        otherTank = &gameState.tank1;
    }

    // [bottom left corner of otherTank] - [top right corner of tank]
    posDifference = subtractPoint2d(otherTank->position, offsetPoint2d(tank->position, tank->width, tank->height));

    // [top right corner of otherTank] - [bottom left corner of tank]
    negDifference = subtractPoint2d(offsetPoint2d(otherTank->position, otherTank->width, otherTank->height), tank->position);

    // printf("Pos difference\n");
    // PRINT_POINT2D(posDifference);
    // printf("Neg difference\n");
    // PRINT_POINT2D(negDifference)

    // Only update y movement if the tanks are overlapping in the x direction
    if (otherTank->position.x < modulo(tank->position.x + tank->width, RESOLUTION_X) &&
        modulo(otherTank->position.x + otherTank->width, RESOLUTION_X) > modulo(tank->position.x, RESOLUTION_X))
    {
        maxPosMovement->y = modulo(posDifference.y, RESOLUTION_Y);
        maxNegMovement->y = -modulo(-negDifference.y, RESOLUTION_Y);
    }
    // Special case for wrap-around
    else if (otherTank->position.x < tank->position.x + tank->width &&
             otherTank->position.x + otherTank->width > tank->position.x)
    {
        maxPosMovement->y = modulo(posDifference.y, RESOLUTION_Y);
        maxNegMovement->y = -modulo(-negDifference.y, RESOLUTION_Y);
        // printf("here, negDifference.y is %d, maxNegMovement is : %d\n", negDifference.y, maxNegMovement->y);
    }
    else if (RESOLUTION_X - otherTank->position.x < otherTank->width &&
             RESOLUTION_X - tank->position.x < tank->width)
    {
        maxPosMovement->y = modulo(posDifference.y, RESOLUTION_Y);
        maxNegMovement->y = -modulo(-negDifference.y, RESOLUTION_Y);
    }
    else if (modulo(otherTank->position.x + otherTank->width, RESOLUTION_X) > tank->position.x &&
             otherTank->position.x + otherTank->width > RESOLUTION_X - 1)
    {
        maxPosMovement->y = modulo(posDifference.y, RESOLUTION_Y);
        maxNegMovement->y = -modulo(-negDifference.y, RESOLUTION_Y);
    }
    else if (modulo(tank->position.x + tank->width, RESOLUTION_X) > otherTank->position.x &&
             tank->position.x + tank->width > RESOLUTION_X - 1)
    {
        maxPosMovement->y = modulo(posDifference.y, RESOLUTION_Y);
        maxNegMovement->y = -modulo(-negDifference.y, RESOLUTION_Y);
    }

    // Only update x movement if the tanks are overlapping in the y direction
    if (otherTank->position.y < modulo(tank->position.y + tank->height, RESOLUTION_Y) &&
        otherTank->position.y + otherTank->height > modulo(tank->position.y, RESOLUTION_Y))
    {
        maxPosMovement->x = MIN(maxPosMovement->x, modulo(posDifference.x, RESOLUTION_X));
        maxNegMovement->x = MAX(maxNegMovement->x, -modulo(-negDifference.x, RESOLUTION_X));
    }

    // Calculating collisions with the other platforms
    for (int i = 0; i < NUM_PLATFORMS; i++)
    {
        // [bottom left corner of the platform] - [top right corner of tank]
        posDifference = subtractPoint2d(gameState.platforms[i].rectangle.p1, offsetPoint2d(tank->position, tank->width, tank->height));

        // [top right corner of the platform] - [bottom left corner of tank]
        negDifference = subtractPoint2d(gameState.platforms[i].rectangle.p2, tank->position);

        // For updating max y movement, the tank needs to have overlapping x coordinates
        // as the platform.
        // The x-left corner of the platform is less than the
        // x-right corner of the tank
        // AND the x-right corner of the platform is greater than the
        // x-left corner of the tank
        if (gameState.platforms[i].rectangle.p1.x < tank->position.x + tank->width &&
            gameState.platforms[i].rectangle.p2.x > tank->position.x)
        {
            maxNegMovement->y = MAX(maxNegMovement->y, -modulo(-negDifference.y, RESOLUTION_Y));
            maxPosMovement->y = MIN(maxPosMovement->y, modulo(posDifference.y, RESOLUTION_Y));
        }
        // // Special case for wrap-around.
        // if (gameState.platforms[i].rectangle.p1.x < tank->position.x + tank->width &&
        //     tank->position.x > modulo(tank->position.x + tank->width, RESOLUTION_X))
        // {
        //     maxNegMovement->y = MAX(maxNegMovement->y, -modulo(-negDifference.y, RESOLUTION_Y));
        //     maxPosMovement->y = MIN(maxPosMovement->y, modulo(posDifference.y, RESOLUTION_Y));
        // }

        // For updating max x movement, the tank needs to have overlapping y coordinates
        // as the platform.
        // The y-bottom corner of the platform is less than the y-top corner
        // of the tank
        // AND the y-top corner of the platform is greater than the y-bottom
        // corner of the tank
        if (gameState.platforms[i].rectangle.p1.y < modulo(tank->position.y + tank->height, RESOLUTION_Y) &&
            gameState.platforms[i].rectangle.p2.y > modulo(tank->position.y, RESOLUTION_Y))
        {

            maxPosMovement->x = MIN(maxPosMovement->x, modulo(posDifference.x, RESOLUTION_X));
            maxNegMovement->x = MAX(maxNegMovement->x, -modulo(-negDifference.x, RESOLUTION_X));
        }
    }
}

