// updates the position, pass in bullet's pointer to modify bullet
void updateBulletCurPosition(Bullet *bullet)
{
    const int EXPLOSION_TIMER = 3;
    static const int BULLET_DAMAGE = 5;
    if (!bullet->exists)
    {
        return;
    }
    bullet->position.x += bullet->velocity.xSpeed;
    // For wraparound along the x-axis
    bullet->position.x = modulo(bullet->position.x, RESOLUTION_X);
    bullet->position.y += bullet->velocity.ySpeed;
    bullet->velocity.ySpeed += bullet->yAcceleration;

    // Checking for collisions with the tanks and platforms

    // Collision with tank 1
    if (hasCollision(bullet->position, bullet->width, bullet->height,
                     gameState.tank1.position, gameState.tank1.width, gameState.tank1.height))
    {
        gameState.tank1.health -= BULLET_DAMAGE;
        bullet->exists = FALSE;
        bullet->hitPosition = bullet->position;
        bullet->explosionTimer = EXPLOSION_TIMER;
        return;
    }
    // Collision with tank 2
    if (hasCollision(bullet->position, bullet->width, bullet->height,
                     gameState.tank2.position, gameState.tank2.width, gameState.tank2.height))
    {
        gameState.tank2.health -= BULLET_DAMAGE;
        bullet->exists = FALSE;
        bullet->hitPosition = bullet->position;
        bullet->explosionTimer = EXPLOSION_TIMER;
        return;
    }

    // Collision with all the platforms
    for (int i = 0; i < NUM_PLATFORMS; i++)
    {
        if (hasCollision(gameState.platforms[i].rectangle.p1,
                         gameState.platforms[i].rectangle.p2.x - gameState.platforms[i].rectangle.p1.x, // Width
                         gameState.platforms[i].rectangle.p2.y - gameState.platforms[i].rectangle.p1.y, // Height
                         bullet->position, bullet->width, bullet->height))
        {
            bullet->exists = FALSE;
            bullet->hitPosition = bullet->position;
            bullet->explosionTimer = EXPLOSION_TIMER;
            return;
        }
    }
}

boolean hasCollision(Point2d bottomLeft1, int width1, int height1, Point2d bottomLeft2, int width2, int height2)
{

    // Adjusting points to remove 'wraparound'
    if (bottomLeft1.x + width1 >= RESOLUTION_X &&
        bottomLeft2.x + width2 < bottomLeft1.x)
    {
        // printf("wraparound adjust 1\n");
        bottomLeft2.x += RESOLUTION_X;
    }
    else if (bottomLeft2.x + width2 >= RESOLUTION_X &&
             bottomLeft1.x + width1 < bottomLeft2.x)
    {
        // printf("wraparound adjust 2\n");
        bottomLeft1.x += RESOLUTION_X;
    }

    return (bottomLeft1.x < bottomLeft2.x + width2 &&
            bottomLeft1.x + width1 > bottomLeft2.x &&
            bottomLeft1.y + height1 > bottomLeft2.y &&
            bottomLeft1.y < bottomLeft2.y + height2);
}

void updateGameStateOnKeyPress(int keyCode)
{
    const int TANK_SPEED = 5;
    const int TANK_UP_SPEED = 3;
    const double GUN_ANGLE_VELOCITY = 0.3;
    const double BULLET_SPEED = 13;
    const double BULLET_Y_ACCELERATION = -1;
    switch (keyCode)
    {
    case PLAYER_1_LEFT_KEYCODE:
        gameState.tank1.velocity.xSpeed = -TANK_SPEED;
        break;
    case PLAYER_1_RIGHT_KEYCODE:
        gameState.tank1.velocity.xSpeed = TANK_SPEED;
        break;
    case PLAYER_2_LEFT_KEYCODE:
        gameState.tank2.velocity.xSpeed = -TANK_SPEED;
        break;
    case PLAYER_2_RIGHT_KEYCODE:
        gameState.tank2.velocity.xSpeed = TANK_SPEED;
        break;
    case PLAYER_1_GUN_ROTATE_LEFT_KEYCODE:
        gameState.tank1.gunBarrel.angleVelocity = GUN_ANGLE_VELOCITY;
        break;
    case PLAYER_1_GUN_ROTATE_RIGHT_KEYCODE:
        gameState.tank1.gunBarrel.angleVelocity = -GUN_ANGLE_VELOCITY;
        break;
    case PLAYER_2_GUN_ROTATE_LEFT_KEYCODE:
        gameState.tank2.gunBarrel.angleVelocity = GUN_ANGLE_VELOCITY;
        break;
    case PLAYER_2_GUN_ROTATE_RIGHT_KEYCODE:
        gameState.tank2.gunBarrel.angleVelocity = -GUN_ANGLE_VELOCITY;
        break;
    case PLAYER_1_SHOOT_KEYCODE:
        if (!gameState.bullet1.exists)
        {
            gameState.bullet1.exists = TRUE;
            gameState.bullet1.position = offsetPoint2d(getGunBarrelTipPosition(&gameState.tank1), -gameState.bullet1.width / 2, -gameState.bullet1.height / 2);
            gameState.bullet1.velocity.xSpeed = BULLET_SPEED * cosValue(gameState.tank1.gunBarrel.angle);
            gameState.bullet1.velocity.ySpeed = BULLET_SPEED * sinValue(gameState.tank1.gunBarrel.angle);
            gameState.bullet1.yAcceleration = BULLET_Y_ACCELERATION;
        }
        break;
    case PLAYER_2_SHOOT_KEYCODE:
        if (!gameState.bullet2.exists)
        {
            gameState.bullet2.exists = TRUE;
            gameState.bullet2.position = offsetPoint2d(getGunBarrelTipPosition(&gameState.tank2), -gameState.bullet2.width / 2, -gameState.bullet2.height / 2);
            gameState.bullet2.velocity.xSpeed = BULLET_SPEED * cosValue(gameState.tank2.gunBarrel.angle);
            gameState.bullet2.velocity.ySpeed = BULLET_SPEED * sinValue(gameState.tank2.gunBarrel.angle);
            gameState.bullet2.yAcceleration = BULLET_Y_ACCELERATION;
        }
        break;
    case PLAYER_1_UP_KEYCODE:
        gameState.tank1.velocity.ySpeed = TANK_UP_SPEED;
        gameState.tank1.isBoosting = TRUE;
        break;
    case PLAYER_2_UP_KEYCODE:
        gameState.tank2.velocity.ySpeed = TANK_UP_SPEED;
        gameState.tank2.isBoosting = TRUE;
        break;
    }
}
void updateGameStateOnKeyRelease(int keyCode)
{
    switch (keyCode)
    {
    case PLAYER_1_LEFT_KEYCODE:
    case PLAYER_1_RIGHT_KEYCODE:
        gameState.tank1.velocity.xSpeed = 0;
        break;

    case PLAYER_2_LEFT_KEYCODE:
    case PLAYER_2_RIGHT_KEYCODE:
        gameState.tank2.velocity.xSpeed = 0;
        break;
    case PLAYER_1_GUN_ROTATE_LEFT_KEYCODE:
    case PLAYER_1_GUN_ROTATE_RIGHT_KEYCODE:
        gameState.tank1.gunBarrel.angleVelocity = 0;
        break;
    case PLAYER_2_GUN_ROTATE_LEFT_KEYCODE:
    case PLAYER_2_GUN_ROTATE_RIGHT_KEYCODE:
        gameState.tank2.gunBarrel.angleVelocity = 0;
        break;
    case PLAYER_1_UP_KEYCODE:
        gameState.tank1.velocity.ySpeed = 0;
        gameState.tank1.isBoosting = FALSE;
        break;
    case PLAYER_2_UP_KEYCODE:
        gameState.tank2.velocity.ySpeed = 0;
        gameState.tank2.isBoosting = FALSE;
        break;
    }
}

