void update_box_pos()
{
    for (int iBox = 0; iBox < NUM_BOXES; ++iBox)
    {
        // Updating the direction if the box is at the x/y boundaries
        if (boxes[iBox].x_pos + BOX_LEN - 1 == RESOLUTION_X - 1 || boxes[iBox].x_pos == 0)
        {
            boxes[iBox].x_dir = boxes[iBox].x_dir == 1 ? -1 : 1;
        }
        if (boxes[iBox].y_pos + BOX_LEN - 1 == RESOLUTION_Y - 1 || boxes[iBox].y_pos == 0)
        {
            boxes[iBox].y_dir = boxes[iBox].y_dir == 1 ? -1 : 1;
        }

        // Updating the positions
        boxes[iBox].old_x_pos = boxes[iBox].x_pos;
        boxes[iBox].old_y_pos = boxes[iBox].y_pos;

        boxes[iBox].x_pos += boxes[iBox].x_dir;
        boxes[iBox].y_pos += boxes[iBox].y_dir;
    }
}

void backward_box_pos()
{
    for (int i = 0; i < 2; i++)
    { // step backward twice
        for (int iBox = 0; iBox < NUM_BOXES; ++iBox)
        {
            // Updating the direction if the box is at the x/y boundaries
            if (boxes[iBox].x_pos + boxes[iBox].x_dir == RESOLUTION_X || boxes[iBox].x_pos + boxes[iBox].x_dir == -1)
            {
                boxes[iBox].x_dir = boxes[iBox].x_dir == 1 ? -1 : 1;
            }
            if (boxes[iBox].y_pos + boxes[iBox].y_dir == RESOLUTION_Y || boxes[iBox].y_pos + boxes[iBox].y_dir == -1)
            {
                boxes[iBox].y_dir = boxes[iBox].y_dir == 1 ? -1 : 1;
            }

            // Updating the positions
            boxes[iBox].x_pos += boxes[iBox].x_dir;
            boxes[iBox].y_pos += boxes[iBox].y_dir;
        }
    }
}

void plot_pixel(int x, int y, short int pixel_color)
{
    if (!g->wrapAround)
    {
        // x %= (RESOLUTION_X-1);
        // y %= (RESOLUTION_Y - 1);
        if (x < 0 || x > RESOLUTION_X || y < 0 || y > RESOLUTION_Y - 1)
        {
            return;
        }
        y = RESOLUTION_Y - 1 - y;
        *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = pixel_color;
    }
    else
    {
        if (y < 0 || y > RESOLUTION_Y - 1)
        {
            return;
        }
        y = RESOLUTION_Y - 1 - y;
        *(short int *)(pixel_buffer_start + (y << 10) + (modulo(x, RESOLUTION_X) << 1)) = pixel_color;
    }
}

void draw_line(int x1, int y1, int x2, int y2, short int line_color)
{
    boolean is_steep = ABS(y2 - y1) > ABS(x2 - x1);

    // We hardcode the later loops to always increment the x-coordinate,
    // so if the line is too steep, we swap the x and y values so that
    // when we are incrementing x, we're actually incrementing y!
    if (is_steep)
    {
        swap(&x1, &y1);
        swap(&x2, &y2);
    }

    if (x1 > x2)
    {
        swap(&x1, &x2);
        swap(&y1, &y2);
    }
    int deltax = x2 - x1;
    int deltay = ABS(y2 - y1);
    int error = -(deltax / 2);
    int y = y1;

    int x_step = (x2 - x1) > 0 ? 1 : -1;
    int y_step = (y2 - y1) > 0 ? 1 : -1;

    for (int x = x1; x <= x2; x += x_step)
    {
        if (is_steep)
        {
            plot_pixel(y, x, line_color);
        }
        else
        {
            plot_pixel(x, y, line_color);
        }
        error = error + deltay;
        if (error > 0)
        {
            y += y_step;
            error -= deltax;
        }
    }
}

