// rotates the p around cx, cy by angle

Point2d __attribute__((optimize("O0"))) rotate_point(int cx, int cy, Point2d p)
{
    //   float s = sin(angle); //0
    //   float c = cos(angle); // 1
    float s = g->sin; // 0
    float c = g->cos; // 1

    // printf("1: pt: cx: %d, p.x: %d,\n",cx,p.x);
    //  translate point back to origin:
    p.x -= cx; // p.x
    p.y -= cy; // p.y
    // printf("2: pt: cx: %d, p.x: %d, s: %f , c:%f\n",cx,p.x,s,c);
    //  rotate point
    double xnew = p.x * c - p.y * s; // p.x - 0
    double ynew = p.x * s + p.y * c; // p.y
    // double test = 10 * 1 - 0;
    //   printf("3: xnew: %lf \n",xnew);
    //   printf("3: test: %lf \n",test);
    // translate point back:
    // printf("before incre: cx: %d, p.x: %d xnew: %lf\n",cx,p.x, xnew);
    p.x = xnew + cx;
    // printf("after incre: cx: %d, p.x: %d xnew: %lf\n",cx,p.x, xnew);
    p.y = ynew + cy;
    return p;
}

void drawpixelByAngleAroundAPoint(Point2d *centre, Point2d *pixelLocation, Renderer *g)
{

    // find current length and angle of the pixel
    double length = sqrt((centre->x - pixelLocation->x) * (centre->x - pixelLocation->x) +
                         (centre->y - pixelLocation->y) * (centre->y - pixelLocation->y));
    // find angle
    double curAngle = atan((pixelLocation->y - centre->y) / (pixelLocation->x - centre->x));
    if (pixelLocation->x < centre->x)
    {
        curAngle += PI;
    }

    // rotate the pixel to degree = current angle + user angle

    Point2d to;
    to.x = centre->x + length * cos(g->angle + curAngle);
    to.y = centre->y + length * sin(g->angle + curAngle);

    plot_pixel(to.x, to.y, g->colour);
}

