/**
 * @brief   Uses the midpoint circle algorithm.
 *
 * @param   circle
 */
void drawCircle(Circle *circle)
{

    int x = circle->radius;
    int y = 0;
    int circularError = 3 - 2 * circle->radius;

    draw_line(circle->center.x - x, circle->center.y, circle->center.x + x, circle->center.y, circle->colour);
    // Calculate points for the rightmost octant of the circle, and reflect it symmetrically.
    while (x > y)
    {
        if (circularError > 0)
        {
            circularError += 10 - 4 * x + 4 * y;
            x--;
        }
        else
        {
            circularError += 6 + 4 * y;
        }
        y++;

        // Octants are counted from 1 counterclockwise, where 1 is the octant above the x axis.

        // Octant 4 to 1
        draw_line(circle->center.x - x, circle->center.y + y, circle->center.x + x, circle->center.y + y, circle->colour);
        // Octant 3 to 2; flip x and y
        draw_line(circle->center.x - y, circle->center.y + x, circle->center.x + y, circle->center.y + x, circle->colour);
        // Octant 5 to 8; negate y
        draw_line(circle->center.x - x, circle->center.y - y, circle->center.x + x, circle->center.y - y, circle->colour);
        // Octant 6 to 7; negate y and flip x and y
        draw_line(circle->center.x - y, circle->center.y - x, circle->center.x + y, circle->center.y - x, circle->colour);
    }
}

