// Define the IRQ exception handler
void __attribute__((interrupt)) __cs3_isr_irq(void)
{
    // Read the ICCIAR from the CPU Interface in the GIC
    int interrupt_ID = *((int *)0xFFFEC10C);
    if (interrupt_ID == 73) // check if interrupt is from the KEYs
        pushbutton_ISR();
    else if (interrupt_ID == IRQ_PS2_KEYBOARD)
        keyboard_ISR();
    else
        while (1)
            ; // if unexpected, then stay here
    // Write to the End of Interrupt Register (ICCEOIR)
    *((int *)0xFFFEC110) = interrupt_ID;
}

void pushbutton_ISR(void)
{
    // printf("Key was pressed");
    /* KEY base address */
    volatile int *KEY_ptr = (int *)0xFF200050;
    /* HEX display base address */
    volatile int *HEX3_HEX0_ptr = (int *)0xFF200020;
    int press, HEX_bits;
    press = *(KEY_ptr + 3); // read the pushbutton interrupt register
    *(KEY_ptr + 3) = press; // Clear the interrupt
    if (press & 0x1)        // KEY0
        HEX_bits = 0b00111111;
    else if (press & 0x2) // KEY1
        HEX_bits = 0b00000110;
    else if (press & 0x4) // KEY2
        HEX_bits = 0b01011011;
    else // press & 0x8, which is KEY3
        HEX_bits = 0b01001111;
    *HEX3_HEX0_ptr = HEX_bits;
    return;
}

void keyboard_ISR()
{
    /* Declare volatile pointers to I/O registers (volatile means that IO load
    and store instructions will be used to access these pointer locations,
    instead of regular memory loads and stores) */
    volatile int *PS2_ptr = (int *)PS2_BASE;

    // Reading in the first keypress
    int PS2_data_reg = *(PS2_ptr);          // read the Data register in the PS/2 port
    int RVALID = PS2_data_reg & PS2_RVALID; // extract the RVALID field
    int data_field = PS2_data_reg & PS2_DATA;

    while (RVALID)
    {
        // printf("Keyboard handling %x\n", data_field);
        if (data_field != RELEASE_KEYCODE)
        {
            updateGameStateOnKeyPress(data_field);
        }
        // data_field is a release, and so we check which key was released
        else
        {
            PS2_data_reg = *(PS2_ptr);
            RVALID = PS2_data_reg & PS2_RVALID;
            data_field = PS2_data_reg & PS2_DATA;
            // We've received a break; we MUST wait and keep reading
            // until we've received the corresponding
            // key code
            while (!RVALID)
            {
                PS2_data_reg = *(PS2_ptr);
                RVALID = PS2_data_reg & PS2_RVALID;
                data_field = PS2_data_reg & PS2_DATA;
            }

            //    printf("Keyboard handling %x\n", data_field);
            updateGameStateOnKeyRelease(data_field);
        }

        PS2_data_reg = *(PS2_ptr);
        RVALID = PS2_data_reg & PS2_RVALID; // extract the RVALID field
        data_field = PS2_data_reg & PS2_DATA;
    }

    // printf("Return from keyboard isr \n\n");
    //  printf(".\n\n\n");
}

