//====== ANCHOR Interrupt Setup ======//

void configureAndEnableInterrupts()
{
    disable_A9_interrupts();
    set_A9_IRQ_stack();
    config_GIC();
    config_KEYs();
    config_PS2_Keyboard();
    enable_A9_interrupts();
}

/*
 * Turn off interrupts in the ARM processor
 */
void disable_A9_interrupts(void)
{
    int status = INT_DISABLE | SVC_MODE;
    asm("msr cpsr, %[ps]"
        :
        : [ps] "r"(status));
}
/*
 * Initialize the banked stack pointer register for IRQ mode
 */
void set_A9_IRQ_stack(void)
{
    int stack, mode;
    stack = A9_ONCHIP_END - 7; // top of A9 onchip memory, aligned to 8 bytes
    /* change processor to IRQ mode with interrupts disabled */
    mode = INT_DISABLE | IRQ_MODE;
    asm("msr cpsr, %[ps]"
        :
        : [ps] "r"(mode));
    /* set banked stack pointer */
    asm("mov sp, %[ps]"
        :
        : [ps] "r"(stack));
    /* go back to SVC mode before executing subroutine return! */
    mode = INT_DISABLE | SVC_MODE;
    asm("msr cpsr, %[ps]"
        :
        : [ps] "r"(mode));
}
/*
 * Turn on interrupts in the ARM processor
 */
void enable_A9_interrupts(void)
{
    int status = SVC_MODE | INT_ENABLE;
    asm("msr cpsr, %[ps]"
        :
        : [ps] "r"(status));
}

/* setup the KEY interrupts in the FPGA */
void config_KEYs()
{
    volatile int *KEY_ptr = (int *)KEY_BASE; // pushbutton KEY address
    *(KEY_ptr + 2) = 0xF;                    // enable interrupts for ALL 4 keys
}

void config_PS2_Keyboard()
{
    volatile int *keyboard_ptr = (int *)PS2_BASE;
    // Enabling interrupts in the PS2_Control reg
    *(keyboard_ptr + 1) |= 0x1;
}

/*
 * Configure the Generic Interrupt Controller(GIC)
 */

void config_GIC(void)
{
    // Use CPU1, NOT 0 for some reason!
    config_interrupt(IRQ_PUSH_BUTTONS, 1); // configure the KEYs parallel port (Interrupt ID = 73)

    config_interrupt(IRQ_PS2_KEYBOARD, 1);

    // Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all
    // priorities
    int address = MPCORE_GIC_CPUIF + ICCPMR;
    *((int *)address) = 0xFFFF;
    // Set CPU Interface Control Register (ICCICR). Enable signaling of
    // interrupts
    address = MPCORE_GIC_CPUIF + ICCICR;
    *((int *)address) = ENABLE;
    // Configure the Distributor Control Register (ICDDCR) to send pending
    // interrupts to CPUs
    address = MPCORE_GIC_DIST + ICDDCR;
    *((int *)address) = ENABLE;
}

/*
 * Configure Set Enable Registers (ICDISERn) and Interrupt Processor Target Registers (ICDIPTRn).
 * The default (reset) values are used for other registers in the GIC.
 */
void config_interrupt(int N, int CPU_target)
{
    int reg_offset, index, value, address;
    /* Configure the Interrupt Set-Enable Registers (ICDISERn).
     * reg_offset = (integer_div(N / 32) * 4
     * value = 1 << (N mod 32) */
    reg_offset = (N >> 3) & 0xFFFFFFFC;
    index = N & 0x1F;
    value = 0x1 << index;
    address = 0xFFFED100 + reg_offset;
    /* Now that we know the register address and value, set the appropriate bit */
    *(int *)address |= value;
    /* Configure the Interrupt Processor Targets Register (ICDIPTRn)
     * reg_offset = integer_div(N / 4) * 4
     * index = N mod 4 */
    reg_offset = (N & 0xFFFFFFFC);
    index = N & 0x3;
    address = 0xFFFED800 + reg_offset + index;
    /* Now that we know the register address and value, write to (only) the appropriate byte */
    *(char *)address = (char)CPU_target;
}

